import React from 'react'
import { MainLayout } from '../components/templates/layouts'

import { Navigation } from '../components/molecules'

import knobData from "../components/molecules/navigation/navigation.knobs.json";
const { direction, items } = knobData;

const App = () => {

    return (
        <MainLayout>
            <Navigation items={items.default}/>
        </MainLayout>
    )
}

export default App
